import React from "react";
import RenderProjectMembers from "./RenderProjectMembers";
import { Link } from "react-router-dom";

export default function ShowProjects({ project }) {
  return (
    <div>
        <label htmlFor="fhla">Project Title</label>
        <h2>{project.name}</h2>
        <br />
        <br />
        <Link to= "show-single-project">Edit Project</Link>
        <label htmlFor="hfas">Head of the project</label>
        <h3>{project.head}</h3>
        <br />
        <label htmlFor="lafj">Project Description: </label>
        <h3>{project.desc}</h3>
        {
            project.members.map((obj) => {
                return <RenderProjectMembers user={obj} />
            })
        }


    </div>
  );
}
